import HorizonLine from "../horizontal";

export default function ServerTime({ text }) {
  return (
    <div style={{ 
      display: "inline-block", 
      width: "256px", 
      height: "97px", 
      border: "1px solid #70BB53",
      marginTop: "13px",
      borderRadius: "8px", 
      backgroundColor: "#ffffff",
      verticalAlign: "top", // 부모 요소의 수직 정렬 방식을 top으로 설정
      textAlign: "center", // 텍스트 가운데 정렬
      lineHeight: "97px", // 박스의 높이와 같은 값으로 설정하여 수직 가운데 정렬
    }}>
      <span style={{  
        fontSize: "14px", // 폰트 크기 조정
        display: "flex", // flex로 설정하여 수직 가운데 정렬
        justifyContent: "center", // 가로 가운데 정렬
        alignItems: "center" // 세로 가운데 정렬
      }}>서버 시간: {text}</span>
      <HorizonLine />
    </div>
  );
}
